import { AppBar, Toolbar } from "@material-ui/core";

import React from "react";

export default function Header() {
  const displayHeader = () => {
    return <Toolbar>Snackpass</Toolbar>;
  };

  return (
    <header>
      <AppBar>
        {displayHeader}

        <Toolbar>Tooobar here</Toolbar>
      </AppBar>
    </header>
  );
}
